PREFIX dbpedia: <http://dbpedia.org/ontology/>

SELECT ?bandMember ?musicalArtist
WHERE {
  ?bandMember a dbpedia:BandMember;
            dbpedia:isMemberOf dbpedia:Band .
  ?bandMember dbpedia:associatedMusicalArtist ?musicalArtist .
}
```

This query looks for band members (`?bandMember`) who are part of a band (`dbpedia:BandMember`), and then associates each with a musical artist (`?musicalArtist`).

